function Home() {
  return (
    <>
      <HeroSection />
      {console.log('\xef\xbf\xbd\xef\xbf\xbd\xef\xbf\xbd\xe0\xb2\xbe')}
      <div id="tutorial">
      <Cards/>
      </div>
      <Footer />
    </>
  );
}

export default Home;
